import React, {FunctionComponent} from 'react';
import Project from '../models/project';
import { stringify } from 'querystring';

type Props = {
    project: Project,
    statut: statut
};

const projectCard: FunctionComponent<Props> = ({project, statut}) => {
    return (
        <div>
            <td>Prokect leader: {project.ProjectLeader}</td>
            <td>Statut: {project.Statut.toString()}</td>
        </div>
   
    )
};

export default projectCard;
